import './App.css';
import logo from "./img/logo.png"
import Img from 'react-image'

function App() {
  return (
    <div className="App-header">
      <Formulario />
    </div>
  );
}

function Formulario(){
  return (
    <div className='form'>
      <img src={logo} className='logo'/>
        <label>
        Login:
         <input name="myInput" className='dadosLogin' defaultValue="1000" />
        </label>
        <label>
        Senha:
         <input name="mySenha" className='dadosLogin' defaultValue="147258" />
        </label>
        <button>
          Login
        </button>

    </div>
  );
}

export default App;
